(1, '<!--\r\n	Marc Fraser''s XML chart interface to pChart.  Only works in collaboration with chart.php (also authored by Marc Fraser, but uses the pChart libraries.\r\n-->\r\n\r\n<chart>\r\n	<chartSeries>\r\n		<series>\r\n			<name>Sales</name>\r\n			<dbCol>otherCol</dbCol>\r\n			<description>Number Sales</description>\r\n			<axis>0</axis>\r\n		</series>\r\n		<series>\r\n			<name>noSales</name>\r\n			<dbCol>noSales</dbCol>\r\n			<description>Number Sales 1</description>\r\n			<axis>0</axis>\r\n		</series>\r\n	</chartSeries>\r\n	<axes>\r\n		<axis>\r\n			<number>0</number>\r\n			<name>otherCol</name>\r\n			<unit>CDs</unit>\r\n			<position>AXIS_POSITION_LEFT</position>\r\n		</axis>\r\n	</axes>\r\n	<image>\r\n		<xSize>700</xSize>\r\n		<ySize>250</ySize>\r\n		<graphArea>\r\n			<x1></x1>\r\n			<x2></x2>\r\n			<y1></y1>\r\n			<y2></y2>\r\n		</graphArea>\r\n		\r\n	</image>\r\n	<legend>\r\n		<xPos>563</xPos>\r\n		<yPos>16</yPos>\r\n	</legend>\r\n	<abscissa>\r\n		<name>Month</name>\r\n		<dbCol>month</dbCol>\r\n	</abscissa>\r\n	<chartName>Sales over Time</chartName>\r\n	<chartType>Line</chartType>\r\n	<sqlQuery>\r\n		<columns>\r\n			<column>otherCol</column>\r\n			<column>month</column>\r\n			<column>noSales</column>\r\n		</columns>\r\n		<tables>\r\n			<table>sales</table>\r\n		</tables>\r\n	</sqlQuery>\r\n	<title>\r\n		<name>This is a sample bar chart</name>\r\n		<xPos>350</xPos>\r\n		<yPos>25</yPos>\r\n		<rColour>0</rColour>\r\n		<gColour>0</gColour>\r\n		<bColour>0</bColour>\r\n		<align>TEXT_ALIGN_MIDDLEMIDDLE</align>\r\n		<fontName>Forgotte.ttf</fontName>\r\n		<fontSize>14</fontSize>\r\n	</title>\r\n	<background>\r\n		<rColour>170</rColour>\r\n		<gColour>183</gColour>\r\n		<bColour>87</bColour>\r\n		<dash>1</dash><!-- 1 or 0 (off) -->\r\n		<rColourDash>190</rColourDash>\r\n		<gColourDash>203</gColourDash>\r\n		<bColourDash>107</bColourDash>\r\n		<gradient>\r\n			<on>1</on><!-- 1 or 0 (off) -->\r\n			<startRColour>219</startRColour>\r\n			<startGColour>231</startGColour>\r\n			<startBColour>139</startBColour>\r\n			<endRColour>1</endRColour>\r\n			<endGColour>138</endGColour>\r\n			<endBColour>68</endBColour>\r\n			<transparency>50</transparency> <!-- between 0 and 100% -->\r\n			<direction>DIRECTION_VERTICAL</direction>\r\n		</gradient>\r\n	</background>\r\n</chart>', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
